  render: (args: {
    size: ButtonProps['size'];
  }) => <div className="space-y-4">\r
            <div className="flex gap-2">\r
                <Button {...args} variant="fill" color="primary" fullWidth>Save Changes</Button>\r
                <Button {...args} variant="fill" color="info" fullWidth>Upgrade Plan</Button>\r
            </div>\r
\r
            <Button {...args} variant="fill" color="primary" fullWidth><LogIn /> Sign In with Email</Button>\r
\r
\r
            <div className="flex gap-2">\r
                <Button {...args} variant="outline" color="secondary">Cancel</Button>\r
                <Button {...args} variant="ghost" color="secondary">Go Back </Button>\r
                <Button {...args} variant="ghost" color="secondary">Skip</Button>\r
            </div>\r
\r
            <div className="flex gap-2">\r
                <Button {...args} variant="link" color="primary">Learn More</Button>\r
                <Button {...args} variant="link" color="secondary">Contact Us</Button>\r
            </div>\r
\r
            <div className="flex gap-2">\r
                <Button {...args} variant="surface" color="secondary" iconOnly><EllipsisVertical /></Button>\r
                <Button {...args} variant="surface" color="info" iconOnly><HelpCircle /></Button>\r
                <Button {...args} variant="surface" color="warning" iconOnly><Info /></Button>\r
                <Button {...args} variant="outline" color="error" iconOnly><Trash2 /></Button>\r
                <Button {...args} variant="outline" color="success" iconOnly><Check /></Button>\r
            </div>\r
\r
            <Button {...args} variant="fill" color="secondary">Login</Button>\r
\r
            <div className='flex gap-2'>\r
                <Button {...args} variant="outline" color="secondary" disabled><ChevronLeft />Previous</Button>\r
                <Button {...args} variant="outline" color="secondary">Next <ChevronRight /></Button>\r
\r
            </div>\r
\r
            <div className='flex gap-2 justify-center'>\r
                <Button {...args} variant="outline" color="secondary" fullWidth><Settings /> Settings</Button>\r
                <Button {...args} variant="outline" color="secondary" fullWidth><Search /> Search</Button>\r
            </div>\r
\r
            <div className='flex gap-2'>\r
                <Button {...args} variant="surface" color="secondary" disabled>\r
                    <LoaderCircle className="animate-spin" /> Searching ...\r
                </Button>\r
                <Button {...args} variant="surface" color="error" disabled>\r
                    <LoaderCircle className="animate-spin" /> Deleting ...\r
                </Button>\r
                <Button {...args} variant="fill" color="info" iconOnly disabled>\r
                    <LoaderCircle className="animate-spin" />\r
                </Button>\r
            </div>\r
\r
            <div className='flex gap-2'>\r
                <Button {...args} variant="surface" color="error">\r
                    <X />\r
                    Reject\r
                </Button>\r
                <Button {...args} variant="outline" color="success">\r
                    Accept\r
                    <Check />\r
                </Button>\r
            </div>\r
\r
\r
            <div className='flex gap-2'>\r
                <Button {...args} variant="ghost" color="secondary">\r
                    Close\r
                </Button>\r
                <Button {...args} variant="fill" color="primary">\r
                    Confirm\r
                </Button>\r
            </div>\r
\r
\r
        </div>
